import React from "react";
import { View, Text } from "react-native";

const RepositoryItem = (props) => {
  const {
    fullName,
    description,
    language,
    forksCount,
    stargazersCount,
    ratingAverage,
    reviewCount,
    ownerAvatarUrl,
  } = props;
  return (
    <View>
      <Text>Hello</Text>
    </View>
  );
};

export default RepositoryItem;
